import React, {Component} from 'react';

class Category extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li><a href="">Lorem ipsum.</a></li>
                    <li><a href="">Dolorem, explicabo!</a></li>

                </ul>
            </div>
        );
    }
}

export default Category;
